    <script>
        //Mobile menu
        $(".drop-box").click(function (e) {
            $("#menu-box").show(100);
            e.stopPropagation();
        });

        $("#menu-box").click(function (e) {
            e.stopPropagation();
        });

        $(document).click(function () {
            $("#menu-box").hide(100);
        });

        //AOS JS
        AOS.init();

        //Rellax JS
        var rellax = new Rellax('.rellax');

        //GSAP JS
        let tl = gsap.timeline({
            scrollTrigger: {
                trigger: "body",
            }
        });

        tl.from(".lp-header", {
            y: -20,
            opacity: 0,
            duration: 0.5,
            ease: "slow"
        })
            .from("#section-2-1-title", {
                x: 20,
                opacity: 0,
                duration: 0.5,
                ease: "circ"
            })
            .from("#section-2-1-subtitle", {
                x: -20,
                opacity: 0,
                duration: 0.5,
                ease: "circ"
            })
            .from("#video-box", {
                x: 10,
                opacity: 0,
                duration: 1.5,
                ease: "circ"
            })
            .from("#section-1-circle-arrow", {
                y: 10,
                opacity: .5,
                duration: 1,
                ease: "slow",
                yoyo: true,
                repeat: -1
            }, "-=2")
            .from("#plant-left", {
                rotate: 2,
                duration: 5,
                ease: "slow",
                yoyo: true,
                repeat: -1
            })
            .from("#plant-right", {
                rotate: 2,
                duration: 4,
                ease: "slow",
                yoyo: true,
                repeat: -1
            })

        // SCROLL
        const body = document.body;
        let lastScroll = 0;

        window.addEventListener("scroll", () => {
            const currentScroll = window.pageYOffset;
            if (currentScroll <= 0) {
                body.classList.remove("scroll-up");
                return;
            }

            if (currentScroll > lastScroll && !body.classList.contains("scroll-down")) {
                body.classList.remove("scroll-up");
                body.classList.add("scroll-down");
            } else if (
                currentScroll < lastScroll &&
                body.classList.contains("scroll-down")
            ) {
                body.classList.remove("scroll-down");
                body.classList.add("scroll-up");
            }
            lastScroll = currentScroll;
        });

    </script>

